"use strict";

const BinaryStoreError = require("./binarystore-error.js");

class LockDoesNotExist extends BinaryStoreError {
  constructor(cause, message) {
    super(message || "Lock of uuBinary does not exist.", cause);
    this.code = `${BinaryStoreError.ERROR_PREFIX}lockDoesNotExist`;
  }
}

module.exports = LockDoesNotExist;
